import './Favourites.css';

class Favourites extends Component{
    componentDidMount(){
        console.log(JSON.parse((localStorage.getItem('username'))).favourites);
    }
    
    render(){
        return(
            <div id='PopularTab'>
                <p>Soon To Be Favourites Tab</p>
            </div>
        )
    }
}

export default Favourites;
